import React, { useContext } from "react";
import Home from "./layout/Home";
import DarkLightTheme, { DarkLightMod } from "./contexts/Context";
import "./app.css";
function App() {

  const { theme } = useContext(DarkLightMod);

  return (
    <div className={theme ? 'dark' : 'light'}>
      <DarkLightTheme>
        <Home/>
      </DarkLightTheme>
    </div>
  );
}

export default App;
